	(10,55,8,13,14,3,'projects/persistent-grid','com_content','Persistent Grid',X'70657273697374656E742D67726964','','<p>Pastry sweet jelly beans icing dragée macaroon cookie lemon drops. Dragée biscuit powder muffin tart sweet wafer. Sugar plum sesame snaps powder unerdwear.com jelly powder. Biscuit jelly beans pie cake marzipan. Jelly biscuit jelly-o gummies chocolate cake. Carrot cake donut jelly-o pastry gummies powder. Dessert donut tiramisu pie cheesecake. Tart chocolate pie jelly oat cake gummi bears gummies. Caramels topping pastry sweet donut ice cream.</p>\r\n<p>Jujubes marshmallow liquorice liquorice chocolate cake. Ice cream chocolate cake applicake. Sugar plum wafer jujubes lollipop chocolate cake soufflé dessert. Tootsie roll candy sweet roll topping biscuit. Carrot cake biscuit marzipan apple pie sweet roll dragée halvah lollipop.</p>',1,0,'0000-00-00 00:00:00',1,'{\"category_layout\":\"crossinghippos:project\",\"image\":\"images\\/projects\\/persistentgrid.png\"}','','','{\"author\":\"\",\"robots\":\"\"}',623,'2013-11-30 19:18:08',623,'2013-12-07 20:34:05',0,'*',1),
