VALUES
	(1,37,'About Crossing Hippos',X'61626F75742D63726F7373696E672D686970706F73','<p>Chupa chups cupcake jelly tiramisu pastry. Pudding lollipop apple pie bonbon candy canes tiramisu dessert bonbon jujubes. Pudding chocolate bar pudding chocolate halvah muffin jujubes. Cookie topping brownie candy canes jelly muffin gummi bears. Biscuit biscuit oat cake. Soufflé applicake fruitcake. Croissant carrot cake muffin dessert caramels. Lollipop tart candy pastry gummi bears pie apple pie. Tart chocolate bar chocolate cake marshmallow cupcake cotton candy macaroon bonbon tootsie roll. Icing macaroon dragée cake pie. Sugar plum marzipan candy canes donut cotton candy carrot cake cake halvah marshmallow.</p>\r\n','\r\n<p>Chupa chups halvah jelly-o brownie fruitcake marzipan. Applicake ice cream gingerbread fruitcake wafer bear claw applicake. Gummies donut icing marshmallow. Toffee bear claw chocolate bonbon unerdwear.com. Sweet roll jelly lollipop dessert. Gingerbread cookie pudding fruitcake. Dessert topping powder wafer sweet ice cream candy. Jelly-o gummies sesame snaps marzipan cotton candy gingerbread. Bonbon sweet roll fruitcake. Cheesecake cotton candy muffin jujubes cookie unerdwear.com macaroon chocolate cake donut. Jelly dessert jelly lemon drops. Sesame snaps bonbon unerdwear.com candy applicake topping tiramisu. Chocolate chocolate cake cheesecake brownie donut carrot cake sweet roll. Sweet cheesecake donut jelly beans chocolate. Danish powder oat cake cake tiramisu pie oat cake lollipop. Jelly-o tart cupcake caramels cotton candy gummi bears ice cream chocolate bar. Sweet roll jelly cotton candy. Applicake applicake apple pie gingerbread. Croissant carrot cake halvah dessert sweet. Donut sugar plum gummies ice cream lemon drops gummi bears tootsie roll sugar plum gummies. Sesame snaps bear claw cheesecake jelly-o fruitcake tiramisu chocolate cake bear claw.</p>\r\n<p>&nbsp;</p>\r\n<p>Cheesecake sweet chocolate cake icing macaroon brownie apple pie lollipop chupa chups. Topping muffin pie. Chocolate fruitcake danish chocolate jelly pudding oat cake cake jujubes. Chocolate cake liquorice bear claw sugar plum powder jelly-o brownie. Lollipop danish tart sweet roll jelly beans jelly jelly applicake soufflé. Unerdwear.com apple pie danish bonbon. Sweet roll chupa chups powder liquorice cake unerdwear.com cheesecake dessert sesame snaps. Dessert marshmallow toffee lollipop chocolate jelly chocolate candy sugar plum. Toffee chocolate bar danish. Topping tart unerdwear.com jujubes lollipop.</p>\r\n<p>&nbsp;</p>\r\n<p>Sweet roll gummies jelly beans fruitcake bear claw macaroon topping bear claw. Tart jelly beans jelly sesame snaps macaroon chocolate. Gummi bears pie cotton candy. Sweet cake icing cheesecake powder jelly beans gummi bears biscuit. Jujubes chocolate bar jelly-o wafer cotton candy chocolate bar lemon drops chupa chups cupcake. Jujubes applicake bear claw muffin bonbon dessert marshmallow. Marshmallow ice cream ice cream gingerbread candy dessert. Brownie jujubes candy canes. Sweet donut powder lemon drops dragée jelly bear claw gummies.</p>',1,15,'2013-09-14 10:43:53',623,'','2013-12-08 20:42:10',623,623,'2013-12-08 20:42:10','2013-09-14 10:43:53','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',11,2,'','',1,741,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),
	(2,44,'Why I have a new logo',X'7768792D692D686176652D612D6E65772D6C6F676F','<p>Powder chupa chups bear claw fruitcake gummies candy canes. Soufflé wafer lollipop lollipop wafer sesame snaps brownie cookie. Muffin chocolate caramels bonbon danish sugar plum gingerbread. Dessert donut jelly.</p>\r\n','\r\n<p>Macaroon halvah cake powder liquorice. Candy canes bear claw powder cupcake biscuit. Jelly-o tart chupa chups lemon drops bonbon. Donut unerdwear.com dessert icing marshmallow gummies. Macaroon danish candy powder. Icing jelly beans toffee caramels lemon drops sweet roll. Icing applicake toffee halvah carrot cake cheesecake tootsie roll jelly beans. Gummies bonbon cupcake carrot cake powder. Sweet biscuit danish chocolate cheesecake biscuit tootsie roll. Sugar plum unerdwear.com pudding sesame snaps liquorice biscuit. Cookie gummies applicake bear claw cheesecake chocolate cake halvah toffee. Sugar plum bonbon cupcake cheesecake bear claw pastry cake chocolate bar. Toffee dessert wafer applicake apple pie gummies sweet roll dragée.</p>',1,15,'2013-11-21 10:50:31',623,'','2013-12-08 20:41:13',623,0,'0000-00-00 00:00:00','2013-11-21 10:50:31','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,1,'','',1,31,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),
	(3,45,'Persistent Grid - the laydown',X'70657273697374656E742D677269642D7468652D6C6179646F776E','<p>Lemon drops applicake macaroon marzipan dessert candy canes cake caramels. Ice cream halvah unerdwear.com ice cream cookie. Dragée cheesecake cake dragée. Ice cream toffee lollipop cotton candy jelly-o pudding gummies chocolate cake sweet.</p>\r\n','\r\n<p>Donut dessert macaroon pastry marshmallow dragée jelly lemon drops lollipop. Powder brownie dessert cotton candy danish jelly. Croissant brownie powder pudding chocolate bar tootsie roll bear claw macaroon. Lollipop chupa chups jelly beans tootsie roll chocolate biscuit. Dessert tiramisu pastry topping fruitcake biscuit. Gummi bears bonbon lollipop bonbon jelly-o croissant liquorice. Caramels donut cupcake dessert lemon drops cake marshmallow. Gingerbread cake gingerbread soufflé cake unerdwear.com liquorice muffin. Biscuit biscuit sweet roll. Apple pie fruitcake toffee wafer chupa chups biscuit icing sugar plum. Sugar plum pie powder soufflé wafer. Caramels caramels cupcake fruitcake macaroon caramels. Tootsie roll caramels chocolate cake wafer carrot cake halvah jelly beans. Topping gummies muffin liquorice bonbon.</p>',1,10,'2013-11-21 10:50:48',623,'','2013-12-08 20:41:34',623,0,'0000-00-00 00:00:00','2013-11-21 10:50:48','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_